      }]
    };
  },
  methods: {
    checkPermission(tab) {
      if (!tab.permision) {
        return true;
      }
      return this.playerPermissions.includes(tab.permision);
    }
  },
  props: {
    isMapRoute: Boolean
  },
  computed: {
    playerList() {
      return this.$store.getters["family/getFamilyList"];
    },
    playerPermissions() {
      return this.$store.getters["family/getPlayerPermissions"];
    },
    TerritoriesWarDataInfo() {
      return this.$store.getters["family/getTerritoriesWarDataInfo"];
    }
  }
};
